import { useSelector, useDispatch } from 'react-redux';
import {
  ucitajSveNastavnike,
  ucitajNastavnika,
} from '../redux/nastavnici/actions';
import styles from './Nastavnici.module.css';
import { Link } from 'react-router-dom';

function Nastavnici() {
  const nastavnici = useSelector((state) => state.nastavnici);
  const nastavnik = useSelector((state) => state.nastavnik);
  console.log(1234, nastavnik);
  const dispatch = useDispatch();

  return (
    <div>
      {nastavnici && (
        <button
          onClick={() => {
            dispatch(ucitajSveNastavnike());
          }}
        >
          Svi nastavnici
        </button>
      )}

      {!nastavnik &&
        nastavnici.items.map((nast) => {
          return (
            <div key={nast.idNastavnik} className={styles.nastavnici}>
              <p>{nast.ime + ' ' + nast.prezime}</p>
              <Link
                to={'/nastavnici/' + nast.idNastavnik}
                onClick={() => {
                  dispatch(ucitajNastavnika(nast.idNastavnik));
                }}
              >
                Details
              </Link>
            </div>
          );
        })}

      {<p>{nastavnik.items}</p>}
    </div>
  );
}

export default Nastavnici;
